$_MODULE['<{ntstats}prestashop>faq_92638a963b369f2abb22f0154a03173e'] = 'The prices are with taxes included';
$_MODULE['<{ntstats}prestashop>faq_223dfa4512ba9e763670e4b0228127c2'] = 'How to open exported CSV files?';
$_MODULE['<{ntstats}prestashop>faq_c1d2c0a2ea8633b6ab80711bf354ff4b'] = 'CSV files can be opened with any kind of spreadsheet programs';
$_MODULE['<{ntstats}prestashop>faq_385e03095df6cced36e6049ce88af49c'] = 'CSV files are in UTF-8 and values are separated by semicolons';
$_MODULE['<{ntstats}prestashop>faq_57cf480337bb1497af02f284ca824d72'] = 'Weird characters appear when openning CSV file?';
$_MODULE['<{ntstats}prestashop>faq_085984a9851c2f27369eb2912dd1e280'] = 'The file is encoded in UTF8 (International unicode)';
$_MODULE['<{ntstats}prestashop>faq_d5c26aac16ededd3ab0d1486e971522a'] = 'If you use Excel, open an new worksheet, go to the Data tab et click on \"From Text\". Once you have chosen your file, in File origin choose Unicode (UTF-8) (at the bottom of the list).';
$_MODULE['<{ntstats}prestashop>faq_bee7dd3645050f8ed95183a8ca55f334'] = 'If you use LibreOffice, when you open the file, it will directly ask the information. In Character Set, choose Unicode (UTF-8)';
$_MODULE['<{ntstats}prestashop>faq_8cb89975e3df60839d85e374bca3ceef'] = 'What does the Need column mean?';
$_MODULE['<{ntstats}prestashop>faq_9c2e60619d2c3362fc9543d0c23b1e62'] = 'This is a very simple hint for controlling stocks based on sales. It corresponds to the formula: (current quantity - quantity sold) * -1.';
$_MODULE['<{ntstats}prestashop>faq_241a721e3fa1612d4d7c50bf36dbb433'] = 'A positive number indicates the quantity that you need to buy in order to be able to sell the same quantity in the same period, you do not have enough stock for that product.';
$_MODULE['<{ntstats}prestashop>faq_58da8a234d6ebaed3ec09553ed7b5e1d'] = 'A negative number indicates the quantity that you should get rid of (via discounts for example) because you have too much stock for this product if you sell the same quantity over the same period.';
$_MODULE['<{ntstats}prestashop>faq_50fe9d94822e8a6d1ed52600d8c071cc'] = 'How to update the module?';
$_MODULE['<{ntstats}prestashop>faq_c45a02babc859c783cc1a5b21b62cdfd'] = 'You need to download the last version of the module from whre you purchased it.';
$_MODULE['<{ntstats}prestashop>faq_cf832f19d14486b25d11aaf8e9cc016d'] = 'Then in the backoffice of your shop, in Modules > Modules Manager, click on the Install module button and choose the module zip file.';
$_MODULE['<{ntstats}prestashop>faq_a9f902c1ce6abfbf5cd3573d49973d87'] = 'Prestashop will detect your current version and update automatically your module.';
$_MODULE['<{ntstats}prestashop>faq_3384251ff34a299aae3717020c8e0bfd'] = 'There is no need to uninstall the module first.';
$_MODULE['<{ntstats}prestashop>faq_380ef96b1c7b37ad905cd5936af73b80'] = 'What does the \"Stock duration\" column mean?';
$_MODULE['<{ntstats}prestashop>faq_515113cf7b9d6b48a8bc545a77bb9775'] = 'The \"Stock duration\" column indicate how many days of stock you have, based on the quantity of products sold during the chosen period.';
$_MODULE['<{ntstats}prestashop>faq_28ab2c484acddc25bcbe2f2740ab115b'] = 'Why is the number display in the module different than the number of orders in the Prestashop Orders tab for the same day?';
$_MODULE['<{ntstats}prestashop>faq_3888ef42b833759863021e51386cfcf2'] = 'By default, the module display orders depending of their invoice dates, not their creation dates.';
$_MODULE['<{ntstats}prestashop>faq_d57075a75979b8bed6d01e8a54778c77'] = 'Also, the orders status must be valid.';
$_MODULE['<{ntstats}prestashop>faq_08a5e00ef7c92f228095380b2398c203'] = 'You can choose, in the module configuration, to display orders depending on their creation dates instead of invoice dates.';
